const Register = () => {
  function handleSubmit(e) {
    e.preventDefault();
  }

  return (
    <section className="register">
      <div className="form__container">
        <form className="form__user" onSubmit={handleSubmit}>
          <h2 className="form__title">Регистрация</h2>
          <input className="form__input" type="email" placeholder="Email" required></input>
          <span className="form__input-error input-title-error"></span>
          <input className="form__input" type="Пароль" placeholder="Email" required></input>
          <span className="form__input-error input-title-error"></span>
          <button className="form__button-submit">Зарегистрироваться</button>
          <span className="form__login">Уже зарегистрированы? Войти</span>
        </form>
      </div>
    </section>
  );
};

export default Register;
